"433":{"id":"433","name":"Mary Poppins","slug":"mary-poppins","original_title":"Mary Poppins","overview":"Na Londres de 1910, o banqueiro Mr. Banks, um homem frio que trata com rigidez Jane e Michael, seus filhos sapecas, não consegue contratar uma babá, pois elas desistem facilmente do emprego. Em uma noite, enquanto redige com sua esposa um anúncio de jornal procurando uma babá, sua filha Jane aparece com uma carta mostrando como seria uma babá perfeita. Esta carta acaba chegando nas mãos de Mary Poppins, que é tudo aquilo que está descrito na carta. Mary Poppins possui poderes mágicos e, com seu amigo faz-tudo Bert, transforma a vida daquela família, com muita música, magia e diversão.","first_air_date":"1964-12-17","runtime":139,"episode_run_time":[139],"vote_average":7.6,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Julie Andrews","Dick Van Dyke","David Tomlinson","Glynis Johns","Hermione Baddeley"],"backdrop_path":"https://image.tmdb.org/t/p/original/prVH6SyQ6yDmzVxxkcr57zhLM5C.jpg","poster_path":"https://image.tmdb.org/t/p/original/1DjJh0vwGwi6KugPZfDiliO25XP.jpg","certification":"L","genres":["Comédia","Família","Fantasia"],"trailer":"N/A"},
