"117251":{"id":"117251","name":"O Ataque","slug":"o-ataque","original_title":"White House Down","overview":"O ex-militar John Cale tinha o grande sonho de entrar para a equipe do serviço secreto que protege o presidente dos Estados Unidos, mas vê sua intenção ir por água abaixo quando não é aprovado na seleção. Sem saber como dar a notícia para sua filha, ele a leva para um passeio à Casa Branca. O que John não esperava era que neste mesmo dia o local fosse atacado por um grupo paramilitar fortemente armado. Com o governo tendo que enfrentar o caos na nação e o relógio correndo, cabe a John encontrar algum jeito de salvar o presidente do ataque.","first_air_date":"2013-06-27","runtime":132,"episode_run_time":[132],"vote_average":6.5,"created_by":["Columbia Pictures","Mythology Entertainment","Centropolis Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Mythology Entertainment"},{"name":"Centropolis Entertainment"}],"cast":["Channing Tatum","Jamie Foxx","Joey King","Maggie Gyllenhaal","Richard Jenkins"],"backdrop_path":"https://image.tmdb.org/t/p/original/eVidMQ5eXDhRizo9ig1X4iWCDqe.jpg","poster_path":"https://image.tmdb.org/t/p/original/kNAF5z4W5NqV8hfkX5CfgPCX2Ur.jpg","certification":"14","genres":["Ação","Drama","Thriller"],"trailer":"N/A"},
