"4347":{"id":"4347","name":"Desejo e Reparação","slug":"desejo-e-reparacao","original_title":"Atonement","overview":"Em 1935, no dia mais quente do ano na Inglaterra, Briony Talles e sua família se reúnem num fim de semana na mansão familiar. O momento político é de tensão, por conta da 2ª Guerra Mundial. Em meio ao calor opressivo emergem antigos ressentimentos familiares. Cinco anos antes, Briony, então aos 13 anos, usa sua imaginação de escritora principiante para acusar Robbie Turner, o filho do caseiro e amante da sua irmã mais velha Cecília, de um crime que ele não cometeu. A acusação na época destruiu o amor da irmã e alterou de forma dramática várias vidas.","first_air_date":"2007-02-27","runtime":123,"episode_run_time":[123],"vote_average":7.6,"created_by":["Universal Pictures","StudioCanal","Relativity Media","Working Title Films"],"production_companies":[{"name":"Universal Pictures"},{"name":"StudioCanal"},{"name":"Relativity Media"},{"name":"Working Title Films"}],"cast":["James McAvoy","Keira Knightley","Saoirse Ronan","Romola Garai","Vanessa Redgrave"],"backdrop_path":"https://image.tmdb.org/t/p/original/prH7Lmo7V9GuMbhCaDCSa6kvZvs.jpg","poster_path":"https://image.tmdb.org/t/p/original/sFIHg2JAyOe6ua0WM2IvcVplrZj.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"e3iNfcvj_jA"},
"1955":{"id":"1955","name":"O Homem Elefante","slug":"o-homem-elefante","original_title":"The Elephant Man","overview":"A história de John Merrick, um desafortunado cidadão da Inglaterra vitoriana que era portador do caso mais grave de neurofibromatose múltipla registrado, tendo 90% do seu corpo deformado. Esta situação tendia fazer com que ele passasse toda a sua existência se exibindo em circos de variedades como um monstro. Inicialmente era considerado um débil mental pela sua dificuldade de falar, até que um médico, Frederick Treves, o descobriu e o levou para um hospital. Lá Merrick se liberou emocionalmente e intelectualmente, além de se mostrar uma pessoa sensível ao extremo, que conseguiu recuperar sua dignidade.","first_air_date":"1980-10-09","runtime":124,"episode_run_time":[124],"vote_average":8.0,"created_by":["Brooksfilms","Paramount Pictures"],"production_companies":[{"name":"Brooksfilms"},{"name":"Paramount Pictures"}],"cast":["Anthony Hopkins","John Hurt","Anne Bancroft","John Gielgud","Wendy Hiller"],"backdrop_path":"https://image.tmdb.org/t/p/original/1YlaU9vXlD4K5EBGZKjaCb9rJb9.jpg","poster_path":"https://image.tmdb.org/t/p/original/tWzF8k2pkdKIVrFDMnN6lwJmLQ.jpg","certification":"10","genres":["Drama","História"],"trailer":"N/A"},
