"20662":{"id":"20662","name":"Robin Hood","slug":"robin-hood","original_title":"Robin Hood","overview":"Robin Longstride (Russell Crowe) integra o exército do rei Ricardo Coração de Leão (Danny Huston), que está em plenas cruzadas. Após a morte do rei, ele consegue escapar juntamente com alguns companheiros. Em sua tentativa de fuga eles encontram Sir Robert Loxley (Douglas Hodge), que tinha por missão levar a coroa do rei a Londres. Loxley foi atacado por Godfrey (Mark Strong), um inglês que serve secretamente aos interesses do rei Filipe, da França. À beira da morte, Loxley pede a Robin que entregue a seu pai uma espada tradicional da família. Ele aceita a missão e, vestido como se fosse um cavaleiro real, parte para Londres. Após entregar a coroa ao príncipe João (Oscar Isaac), que é nomeado rei, Robin parte para Nottingham. Lá conhece Sir Walter (Max von Sydow) e Marion (Cate Blanchett), respectivamente pai e esposa de Loxley.","first_air_date":"2010-05-12","runtime":128,"episode_run_time":[128],"vote_average":6.4,"created_by":["Imagine Entertainment","Relativity Media","Scott Free Productions"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Relativity Media"},{"name":"Scott Free Productions"}],"cast":["Russell Crowe","Cate Blanchett","Max von Sydow","William Hurt","Mark Strong"],"backdrop_path":"https://image.tmdb.org/t/p/original/ttSqbpXPTBITtX9ijGmyYv58Kno.jpg","poster_path":"https://image.tmdb.org/t/p/original/cCzqyuZxvJ38E8DXMbW9q4qgUVa.jpg","certification":"14","genres":["Ação","Aventura","História","Drama"],"trailer":"N/A"},
