"239571":{"id":"239571","name":"O Melhor de Mim","slug":"o-melhor-de-mim","original_title":"The Best of Me","overview":"Adolescentes, Amanda e Dawson se apaixonam. O pai da garota não aprova o relacionamento e, com o passar do tempo, os jovens acabam se afastando e tomando rumos diferentes. Duas décadas mais tarde um funeral faz com que os dois voltem à cidade natal e se reencontrem. É o momento de ver se os sentimentos persistem e avaliar as decisões que tomaram na vida.","first_air_date":"2014-10-15","runtime":118,"episode_run_time":[118],"vote_average":7.5,"created_by":["Relativity Media"],"production_companies":[{"name":"Relativity Media"}],"cast":["Michelle Monaghan","James Marsden","Luke Bracey","Liana Liberato","Gerald McRaney"],"backdrop_path":"https://image.tmdb.org/t/p/original/ydRoUWyhAMv1FstnWlo5EiZWEbc.jpg","poster_path":"https://image.tmdb.org/t/p/original/5Jdy0LnPZsdUTGnvCqpkvQwydud.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"N/A"},
"9655":{"id":"9655","name":"Ela é o Cara","slug":"ela-e-o-cara","original_title":"She's the Man","overview":"Viola é uma boa jogadora de futebol, mas sempre é impedida de jogar com os garotos de sua escola devido ao preconceito de que mulher não pode ser tão boa no esporte quanto um homem. Furiosa, Viola aproveita a viagem de seu irmão Sebastian e decide se passar por ele em sua escola, jogando no time masculino de futebol. Ela tem apenas duas semanas para mostrar que sabe jogar futebol, mas acaba se apaixonando por Duke, seu companheiro de quarto, que acredita que ela é um homem.","first_air_date":"2006-03-17","runtime":112,"episode_run_time":[112],"vote_average":6.8,"created_by":["Lakeshore Entertainment","DreamWorks Pictures","The Donners' Company"],"production_companies":[{"name":"Lakeshore Entertainment"},{"name":"DreamWorks Pictures"},{"name":"The Donners' Company"}],"cast":["Amanda Bynes","Channing Tatum","Laura Ramsey","Vinnie Jones","David Cross"],"backdrop_path":"https://image.tmdb.org/t/p/original/1tqFPSCXcpQhozWiVFasq5AudQz.jpg","poster_path":"https://image.tmdb.org/t/p/original/ooZWyBiibhT8il0MGjOYQYYJcsT.jpg","certification":"12","genres":["Comédia","Romance"],"trailer":"N/A"},
