"30497":{"id":"30497","name":"O Massacre da Serra Elétrica","slug":"o-massacre-da-serra-eletrica","original_title":"The Texas Chain Saw Massacre","overview":"Em 1973, a polícia texana deu como encerrado o caso de um terrível massacre de 33 pessoas provocado por um homem que usava uma máscara feita de pele humana. Nos anos que se seguiram os policiais foram acusados de fazer uma péssima investigação e de terem matado o cara errado. Só que dessa vez, o único sobrevivente do massacre vai contar em detalhes o que realmente aconteceu na deserta estrada do Texas, quando ele e mais 4 amigos estavam indo visitar o seu avô.","first_air_date":"1974-10-11","runtime":83,"episode_run_time":[83],"vote_average":7.3,"created_by":["Vortex","Henkel Productions","Hooper Productions","Bryanston Pictures"],"production_companies":[{"name":"Vortex"},{"name":"Henkel Productions"},{"name":"Hooper Productions"},{"name":"Bryanston Pictures"}],"cast":["Marilyn Burns","Allen Danziger","Paul A. Partain","William Vail","Teri McMinn"],"backdrop_path":"https://image.tmdb.org/t/p/original/wvBx1Q1FcQE1BPLfBbgA3y9aaS1.jpg","poster_path":"https://image.tmdb.org/t/p/original/p4ASEhC23kteI4pabD3cvFccCgO.jpg","certification":"18","genres":["Terror"],"trailer":"N/A"},
"14438":{"id":"14438","name":"À Prova de Fogo","slug":"a-prova-de-fogo","original_title":"Fireproof","overview":"Caleb Holt, um heroico capitão bombeiro que preza a dedicação e o serviço ao próximo acima de tudo. Mas a parceria mais importante de sua vida, seu casamento, está prestes a se desfazer em fumaça. Esta história cativante acompanha o desejo de um homem de transformar sua vida e seu casamento através do poder curativo da fé e de seguir adiante pelo lema dos bombeiros: \"Nunca deixe seu parceiro para trás\".","first_air_date":"2008-09-26","runtime":122,"episode_run_time":[122],"vote_average":7.7,"created_by":["Samuel Goldwyn Films","Affirm Films","Carmel Entertainment","FortyFour Studios","Provident Films","Sherwood Pictures","Kendrick Brothers"],"production_companies":[{"name":"Samuel Goldwyn Films"},{"name":"Affirm Films"},{"name":"Carmel Entertainment"},{"name":"FortyFour Studios"},{"name":"Provident Films"},{"name":"Sherwood Pictures"},{"name":"Kendrick Brothers"}],"cast":["Kirk Cameron","Erin Bethea","Ken Bevel","Stephen Dervan","Ric Young"],"backdrop_path":"https://image.tmdb.org/t/p/original/3gMtnO5vDznlKsUW7sU9EfRufIc.jpg","poster_path":"https://image.tmdb.org/t/p/original/fX1n097j6l7Y47jtph8Z4SwJkbR.jpg","certification":"L","genres":["Drama","Romance"],"trailer":"xYWwUI3j4_Q"},
