"377":{"id":"377","name":"A Hora do Pesadelo","slug":"a-hora-do-pesadelo","original_title":"A Nightmare on Elm Street","overview":"Um grupo de adolescentes tem pesadelos horríveis, onde são atacados por um homem deformado com garras de aço. Ele apenas aparece durante o sono e, para escapar, é preciso acordar. Os crimes vão ocorrendo seguidamente, até que se descobre que o ser misterioso é na verdade Freddy Krueger, um homem que molestou crianças na rua Elm e que foi queimado vivo pela vizinhança. Agora Krueger pode retornar para se vingar daqueles que o mataram, através do sono.","first_air_date":"1984-11-09","runtime":91,"episode_run_time":[91],"vote_average":7.3,"created_by":["New Line Cinema","Smart Egg Pictures","Media Home Entertainment","Cinema 84","The Elm Street Venture"],"production_companies":[{"name":"New Line Cinema"},{"name":"Smart Egg Pictures"},{"name":"Media Home Entertainment"},{"name":"Cinema 84"},{"name":"The Elm Street Venture"}],"cast":["Heather Langenkamp","Robert Englund","Johnny Depp","John Saxon","Ronee Blakley"],"backdrop_path":"https://image.tmdb.org/t/p/original/g9ROrZey0JYp7kf8DoAyZtKnObj.jpg","poster_path":"https://image.tmdb.org/t/p/original/7RDDRv4A4wb85U4QEx2OsRWbCH1.jpg","certification":"16","genres":["Terror"],"trailer":"N/A"},
