"296524":{"id":"296524","name":"Horizonte Profundo: Desastre no Golfo","slug":"horizonte-profundo-desastre-no-golfo","original_title":"Deepwater Horizon","overview":"Baseada em eventos reais, a história se passa no Golfo do México, na plataforma de perfuração marítima Deepwater Horizon. Diante de um dos piores vazamentos de petróleo na história dos EUA, Mike Williams e os demais trabalhadores embarcados lutam para escapar com vida do terrível acidente.","first_air_date":"2016-09-28","runtime":107,"episode_run_time":[107],"vote_average":6.9,"created_by":["Summit Entertainment","Participant","di Bonaventura Pictures","Closest to the Hole Productions","Leverage Entertainment","TIK Films","Lionsgate"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Participant"},{"name":"di Bonaventura Pictures"},{"name":"Closest to the Hole Productions"},{"name":"Leverage Entertainment"},{"name":"TIK Films"},{"name":"Lionsgate"}],"cast":["Mark Wahlberg","Kurt Russell","John Malkovich","Gina Rodriguez","Dylan O'Brien"],"backdrop_path":"https://image.tmdb.org/t/p/original/fRT76SSQzAuZljogpsWyKphUxYX.jpg","poster_path":"https://image.tmdb.org/t/p/original/vWv6Z1nG2KZwaR6IjI7wwhsIJt4.jpg","certification":"12","genres":["Drama","Ação"],"trailer":"bbpMMYVt9p4"},
"339846":{"id":"339846","name":"Baywatch: S.O.S. Malibu","slug":"baywatch-s-o-s-malibu","original_title":"Baywatch","overview":"Quando uma perigosa onda de crime atinge o local, o lendário tenente Mitch Buchannon aciona seu esquadrão de elite de salva-vidas durões, para provar que não é preciso usar um distintivo para cumprir sua missão. Junto com um trio de fortes recrutas, incluindo o ex-olímpico Matt Brody, eles vão deixar o surfe de lado e fazer de tudo para derrotar uma cruel empresária, cujos planos infames ameaçam o futuro da praia.","first_air_date":"2017-05-25","runtime":116,"episode_run_time":[116],"vote_average":6.1,"created_by":["Uncharted","Paramount Pictures","Flynn Picture Company","Fremantle Productions","Seven Bucks Productions","Skydance Media","The Montecito Picture Company"],"production_companies":[{"name":"Uncharted"},{"name":"Paramount Pictures"},{"name":"Flynn Picture Company"},{"name":"Fremantle Productions"},{"name":"Seven Bucks Productions"},{"name":"Skydance Media"},{"name":"The Montecito Picture Company"}],"cast":["Dwayne Johnson","Zac Efron","प्रियंका चोपड़ा जोनस","Alexandra Daddario","Kelly Rohrbach"],"backdrop_path":"https://image.tmdb.org/t/p/original/6QmX2BDVr1hIOIPHqnxvp1C1ZZp.jpg","poster_path":"https://image.tmdb.org/t/p/original/im8xzHCqMAS0RfVeld3cevqNYAc.jpg","certification":"14","genres":["Comédia","Ação","Crime"],"trailer":"b4e4pIGHTFw"},
"274855":{"id":"274855","name":"Tempestade: Planeta em Fúria","slug":"tempestade-planeta-em-furia","original_title":"Geostorm","overview":"E se, após mais de uma década de desastres naturais devastadores, nós descobríssemos uma forma de controlar a mãe natureza e a destruição que ela carrega? Quando uma mudança catastrófica do clima ameaça a sobrevivência da terra, os governos mundiais se unem e criam o Projeto Dutch Boy: uma rede global de satélites ao redor do planeta armados com tecnologias de geo-engenharia desenvolvidas para impedir os desastres naturais. Após proteger o planeta com sucesso por dois anos, algo começa a dar errado. Dois irmão afastados são encarregados de resolver um defeito no funcionamento do programa antes que uma tempestade mundial acabe com tudo.","first_air_date":"2017-10-12","runtime":109,"episode_run_time":[109],"vote_average":6.1,"created_by":["Twisted Media","Skydance Media","RatPac Entertainment","Electric Entertainment","Warner Bros. Pictures","October Pictures"],"production_companies":[{"name":"Twisted Media"},{"name":"Skydance Media"},{"name":"RatPac Entertainment"},{"name":"Electric Entertainment"},{"name":"Warner Bros. Pictures"},{"name":"October Pictures"}],"cast":["Gerard Butler","Alexandra Maria Lara","Jim Sturgess","Abbie Cornish","Ed Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/79X8JkGxzc1tJMi0KxUSaPLooVg.jpg","poster_path":"https://image.tmdb.org/t/p/original/eHg6a64rTJHBZ0N0vEu17HGOsnJ.jpg","certification":"12","genres":["Ação","Ficção científica","Thriller"],"trailer":"lNAC9wVUaqY"},
