"103663":{"id":"103663","name":"A Caça","slug":"a-caca","original_title":"Jagten","overview":"Lucas acaba de passar por um divórcio complicado e é professor em um jardim-de-infância de uma pequena cidade dinamarquesa. A filha de seu melhor amigo, Klara, uma garotinha de 6 anos, acusa Lucas de abuso sexual para vingar-se de um beijo que ele recusou; a menina usa como embasamento a foto de um pênis ereto mostrada pelo seu irmão mais velho. A diretora da escola acredita inteiramente na menina e todos os adultos tentam evitar o seu relato, a fim de supostamente preservá-la da lembrança, enquanto começam a hostilizar Lucas, tomando-lhe como culpado e maníaco.","first_air_date":"2012-06-13","runtime":116,"episode_run_time":[116],"vote_average":8.1,"created_by":["Zentropa International Sweden","Zentropa Entertainments","Film i Väst"],"production_companies":[{"name":"Zentropa International Sweden"},{"name":"Zentropa Entertainments"},{"name":"Film i Väst"}],"cast":["Mads Mikkelsen","Thomas Bo Larsen","Annika Wedderkopp","Lasse Fogelstrøm","Susse Wold"],"backdrop_path":"https://image.tmdb.org/t/p/original/7zN7m5jEyrNxFYm2EbQJAZwAG5i.jpg","poster_path":"https://image.tmdb.org/t/p/original/jksxm18n70boh0LSlXibjimGr9g.jpg","certification":"N/A","genres":["Drama"],"trailer":"gwxYwb7NbDI"},
