"7214":{"id":"7214","name":"Coach Carter: Treino para a Vida","slug":"coach-carter-treino-para-a-vida","original_title":"Coach Carter","overview":"Richmond, Califórnia, 1999. O dono de uma loja de artigos esportivos, Ken Carter, aceita ser o técnico de basquete de sua antiga escola, onde conseguiu recordes e que fica em uma área pobre da cidade. Para surpresa de muitos ele impõe um rígido regime, em que os alunos que queriam participar do time tinham de assinar um contrato que incluía um comportamento respeitoso, modo adequado de se vestir e ter boas notas em todas as matérias. A resistência inicial dos jovens acaba e o time sob o comando de Carter vai se tornando imbatível. Quando o comportamento do time fica muito abaixo do desejável Carter descobre que muitos dos seus jogadores estão tendo um desempenho muito fraco nas salas de aula. Assim Carter toma uma atitude que espanta o time, o colégio e a comunidade.","first_air_date":"2005-01-14","runtime":136,"episode_run_time":[136],"vote_average":7.6,"created_by":["Paramount Pictures","MTV Films","Tollin/Robbins Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"MTV Films"},{"name":"Tollin/Robbins Productions"}],"cast":["Samuel L. Jackson","Rob Brown","Robert Ri'chard","Rick Gonzalez","Nana Gbewonyo"],"backdrop_path":"https://image.tmdb.org/t/p/original/n4CvA50GBtIPrSqCl8nMNZCliYI.jpg","poster_path":"https://image.tmdb.org/t/p/original/xQ3tzSGpIeoJEEamRYcFvoTfZCR.jpg","certification":"14","genres":["Drama","História"],"trailer":"N/A"},
