"59967":{"id":"59967","name":"Looper: Assassinos do Futuro","slug":"looper-assassinos-do-futuro","original_title":"Looper","overview":"Na sociedade futurística de 2074, a viagem no tempo só está disponível a quem é capaz de pagar por ela no mercado negro. Quando os mafiosos querem eliminar alguém, eles enviam o alvo ao passado, onde um matador de aluguel conhecido como \"Looper\" aguarda com a arma na mão. Joe é um desses assassinos contratados, e ele faz muito bem esse trabalho. Entretanto, as complicações surgem quando ele descobre que seu chefe decidiu fechar o ciclo e enviar o Joe do futuro de volta no tempo para matá-lo.","first_air_date":"2012-09-26","runtime":119,"episode_run_time":[119],"vote_average":6.9,"created_by":["Endgame Entertainment","DMG Entertainment","Ram Bergman Productions"],"production_companies":[{"name":"Endgame Entertainment"},{"name":"DMG Entertainment"},{"name":"Ram Bergman Productions"}],"cast":["Joseph Gordon-Levitt","Bruce Willis","Emily Blunt","Paul Dano","Noah Segan"],"backdrop_path":"https://image.tmdb.org/t/p/original/4bAwGmE9Sl4FeXoHWVWLXkURHbe.jpg","poster_path":"https://image.tmdb.org/t/p/original/qi3aMCoFbnfpbd0XBLznLUn99xQ.jpg","certification":"16","genres":["Ação","Thriller","Ficção científica"],"trailer":"31PGFU_bJ3c"},
