"399055":{"id":"399055","name":"A Forma da Água","slug":"a-forma-da-agua","original_title":"The Shape of Water","overview":"Década de 60. Em meio aos grandes conflitos políticos e transformações sociais dos Estados Unidos da Guerra Fria, a muda Elisa, zeladora em um laboratório experimental secreto do governo, se encanta com uma criatura fantástica mantida presa e maltratada no local. Para executar um arriscado e apaixonado resgate, ela recorre ao melhor amigo Giles e à colega de turno Zelda, em uma aventura que pode custar muito mais do que o seu emprego.","first_air_date":"2017-12-01","runtime":123,"episode_run_time":[123],"vote_average":7.2,"created_by":["Double Dare You","Fox Searchlight Pictures","Bull Productions","TSG Entertainment"],"production_companies":[{"name":"Double Dare You"},{"name":"Fox Searchlight Pictures"},{"name":"Bull Productions"},{"name":"TSG Entertainment"}],"cast":["Sally Hawkins","Michael Shannon","Richard Jenkins","Octavia Spencer","Michael Stuhlbarg"],"backdrop_path":"https://image.tmdb.org/t/p/original/5yGgVqsk3v44jfGVuFWIDxOExIF.jpg","poster_path":"https://image.tmdb.org/t/p/original/4ezwRuc1iKlaWTi16qrr44Nzinr.jpg","certification":"16","genres":["Drama","Fantasia","Romance"],"trailer":"-DTVuQTZr3E"},
"225886":{"id":"225886","name":"Sex Tape: Perdido na Nuvem","slug":"sex-tape-perdido-na-nuvem","original_title":"Sex Tape","overview":"Após dez anos de casados, o romance intenso de um casal começa a esfriar. Para apimentar a relação, eles decidem se gravar fazendo sexo. Parece uma grande ideia, até que eles descobrem que seus momentos mais íntimos tornaram-se públicos na Internet. Em pânico, o casal corre contra o tempo atrás da constrangedora gravação.","first_air_date":"2014-07-17","runtime":94,"episode_run_time":[94],"vote_average":5.4,"created_by":["Escape Artists","LStar Capital","MRC","Columbia Pictures"],"production_companies":[{"name":"Escape Artists"},{"name":"LStar Capital"},{"name":"MRC"},{"name":"Columbia Pictures"}],"cast":["Cameron Diaz","Jason Segel","Rob Corddry","Ellie Kemper","Rob Lowe"],"backdrop_path":"https://image.tmdb.org/t/p/original/nFCUBRDF4C6RWopNo0nAfvMA6mm.jpg","poster_path":"https://image.tmdb.org/t/p/original/p7OIKWMWJWziaaX5PIWKDVeA6Of.jpg","certification":"16","genres":["Comédia"],"trailer":"N/A"},
