"760774":{"id":"760774","name":"Uma Vida: A História de Nicholas Winton","slug":"uma-vida-a-historia-de-nicholas-winton","original_title":"One Life","overview":"Uma Vida - A História de Nicholas Winton (Anthony Hopkins) mostra o extraordinário e humanitário Nicholas Witon que, em 1938, durante a Segunda Guerra Mundial, foi visitar Praga e se horrorizou com a situação em que as famílias ali viviam por conta de forte influência da Alemanha nazista. Compadecido com a situação, Nicholas junto com um grupo de apoio, conseguiu ajudar, principalmente crianças, a fugirem do Holocausto e irem para a Inglaterra antes das fronteiras serem fechadas. Entretanto, anos depois, Nicholas Winton fica atormentado com o sentimento de culpa pensando naqueles que ele não conseguiu resgatar. Somente quando ele reencontra com uma sobrevivente que ele socorreu é que ele consegue se livrar do peso da culpa.","first_air_date":"2023-12-21","runtime":109,"episode_run_time":[109],"vote_average":7.8,"created_by":["See-Saw Films","BBC Film","Lipsync Productions","MBK Productions","Cross City Films"],"production_companies":[{"name":"See-Saw Films"},{"name":"BBC Film"},{"name":"Lipsync Productions"},{"name":"MBK Productions"},{"name":"Cross City Films"}],"cast":["Anthony Hopkins","Johnny Flynn","Lena Olin","Romola Garai","Alex Sharp"],"backdrop_path":"https://image.tmdb.org/t/p/original/7kgDHoXEk0EySTczcmaYpPDBFQS.jpg","poster_path":"https://image.tmdb.org/t/p/original/o65cLhzXPp9nBb5RvKRqLfZiMcH.jpg","certification":"N/A","genres":["História","Drama"],"trailer":"N/A"},
"634":{"id":"634","name":"O Diário de Bridget Jones","slug":"o-diario-de-bridget-jones","original_title":"Bridget Jones's Diary","overview":"Bridget Jones, uma mulher de trinta anos, decide, entre as resoluções de Ano Novo escrever um diário. Bridget revela, a cada capítulo, as suas qualidades e os seus defeitos, além de expor com muito humor situações que fazem parte do dia-a-dia de várias mulheres nesta mesma faixa de idade: problemas com o trabalho, a busca do homem ideal etc. Cada capítulo do livro trata de um determinado dia na vida desta anti-heroína, que sempre inicia o seu relato contabilizando o peso e as calorias, cigarros e unidades alcoólicas que consumiu no dia anterior.","first_air_date":"2001-04-13","runtime":97,"episode_run_time":[97],"vote_average":6.7,"created_by":["Universal Pictures","StudioCanal","Miramax","Working Title Films","Little Bird"],"production_companies":[{"name":"Universal Pictures"},{"name":"StudioCanal"},{"name":"Miramax"},{"name":"Working Title Films"},{"name":"Little Bird"}],"cast":["Renée Zellweger","Colin Firth","Hugh Grant","Jim Broadbent","Gemma Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/imvV078HyWsa9jgDVLi4APgskrJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/acjZNtv1H6wVadXnleSmYFjZk5k.jpg","certification":"12","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
