"9567":{"id":"9567","name":"Lágrimas do Sol","slug":"lagrimas-do-sol","original_title":"Tears of the Sun","overview":"O governo nigeriano está falido e o país está à beira de uma guerra civil. O Tenente A.K. Waters é responsável por liderar uma equipe de soldados para a selva para resgatarem a Dra. Lena Kendricks. Quando Waters e sua equipe localizam Kendricks, ela conta que não deixará seus pacientes para serem abatidos por rebeldes. A equipe provoca a ira das forças dos Estados Unidos e da Nigéria quando lado a lado com Kendricks tenta proteger os refugiados.","first_air_date":"2003-03-07","runtime":121,"episode_run_time":[121],"vote_average":6.9,"created_by":["Columbia Pictures","Revolution Studios","Cheyenne Enterprises","Michael Lobell Productions"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Revolution Studios"},{"name":"Cheyenne Enterprises"},{"name":"Michael Lobell Productions"}],"cast":["Bruce Willis","Monica Bellucci","Cole Hauser","Eamonn Walker","Johnny Messner"],"backdrop_path":"https://image.tmdb.org/t/p/original/n2wlMpTuiovYCZHpwKtbSTY8Wor.jpg","poster_path":"https://image.tmdb.org/t/p/original/WksMUDKv4I241w6mR263m3IKBs.jpg","certification":"14","genres":["Guerra","Ação","Drama"],"trailer":"N/A"},
