"87516":{"id":"87516","name":"Oldboy: Dias de Vingança","slug":"oldboy-dias-de-vinganca","original_title":"Oldboy","overview":"Um arrogante executivo, Joe Ducett, é sequestrado e passa 20 anos em cativeiro, sem saber quem o sequestrou ou o motivo. Enquanto isso, ele descobre, pela televisão, que sua ex-esposa foi assassinada e que ele é o principal suspeito. Certo dia, Joe é libertado e, com a ajuda de uma assistente social, ele tem apenas três dias para descobrir a verdade sobre seu sequestro.","first_air_date":"2013-11-14","runtime":104,"episode_run_time":[104],"vote_average":5.9,"created_by":["40 Acres and a Mule Filmworks","Vertigo Entertainment","Good Universe","FilmDistrict","Mandate International"],"production_companies":[{"name":"40 Acres and a Mule Filmworks"},{"name":"Vertigo Entertainment"},{"name":"Good Universe"},{"name":"FilmDistrict"},{"name":"Mandate International"}],"cast":["Josh Brolin","Elizabeth Olsen","Sharlto Copley","Samuel L. Jackson","Michael Imperioli"],"backdrop_path":"https://image.tmdb.org/t/p/original/uiXonqLtnQnwj0h4nuAZiU2YTj5.jpg","poster_path":"https://image.tmdb.org/t/p/original/ztQx1u8Vif626VOqavJAqgLlKNQ.jpg","certification":"18","genres":["Drama","Thriller","Mistério","Ação"],"trailer":"WzSOjxxyYho"},
"9833":{"id":"9833","name":"O Fantasma da Ópera","slug":"o-fantasma-da-opera","original_title":"The Phantom of the Opera","overview":"La Carlotta (Minnie Driver) é a diva de uma conceituada companhia teatral, que é responsável pelas óperas realizadas em um imponente teatro. Temperamental, La Carlotta se irrita pela ausência de um solo na nova produção da companhia e decide abandonar os ensaios. Com a estréia marcada para o mesmo dia, os novos donos do teatro não têm outra alternativa senão aceitar a sugestão de Madame Giry (Miranda Richardson) e escalar em seu lugar a jovem Christine Daae (Emmy Rossum), que fazia parte do coral. Christine faz sucesso em sua estréia, chamando a atenção do Visconde de Chagny (Patrick Wilson), o novo patrocinador da companhia. O Visconde e Christine se conheceram ainda crianças, mas ele apenas a reconhece na encenação da ópera. Porém o que nem ele nem ninguém da companhia, com exceção de Madame Giry, sabem é que Christine tem um tutor misterioso, que acompanha nas sombras tudo o que acontece no teatro: o Fantasma da Ópera (Gérard Butler).","first_air_date":"2004-12-08","runtime":141,"episode_run_time":[141],"vote_average":7.3,"created_by":["Warner Bros. Pictures","Odyssey Entertainment","Scion Films","The Really Useful Group"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Odyssey Entertainment"},{"name":"Scion Films"},{"name":"The Really Useful Group"}],"cast":["Gerard Butler","Emmy Rossum","Patrick Wilson","Miranda Richardson","Minnie Driver"],"backdrop_path":"https://image.tmdb.org/t/p/original/xW7pZW94IwOC5JDZnGemtuYVPVk.jpg","poster_path":"https://image.tmdb.org/t/p/original/tevlea1T7hUA5mZnnrbJnWjtJwV.jpg","certification":"N/A","genres":["Thriller","Drama","Romance"],"trailer":"N/A"},
