"479455":{"id":"479455","name":"MIB Homens de Preto: Internacional","slug":"mib-homens-de-preto-internacional","original_title":"Men in Black: International","overview":"Quando criança, Molly presenciou a abordagem de dois agentes do MIB aos seus pais, apagando a memória deles acerca da súbita aparição de um ser extraterrestre. Como estava escondida, a garota não foi atingida pela ação. Obcecada pelos mistérios do universo, ela cresceu com o sonho de ingressar no MIB. Após muita pesquisa, ela consegue descobrir a sede da agência e lá se candidata a uma vaga, sendo aceita por O. Ainda em experiência, e agora renomeada como agente M, ela é enviada a Londres para investigar algo estranho que tem ocorrido na agência local. É quando conhece o agente H, de grande renome pelos seus feitos no passado mas uma certa arrogância e displicência na execução do trabalho.","first_air_date":"2019-06-12","runtime":115,"episode_run_time":[115],"vote_average":5.9,"created_by":["Amblin Entertainment","Parkes+MacDonald Image Nation","Columbia Pictures","Tencent Pictures"],"production_companies":[{"name":"Amblin Entertainment"},{"name":"Parkes+MacDonald Image Nation"},{"name":"Columbia Pictures"},{"name":"Tencent Pictures"}],"cast":["Chris Hemsworth","Tessa Thompson","Rebecca Ferguson","Kumail Nanjiani","Rafe Spall"],"backdrop_path":"https://image.tmdb.org/t/p/original/uK9uFbAwQ1s2JHKkJ5l0obPTcXI.jpg","poster_path":"https://image.tmdb.org/t/p/original/mxopI5VyShCeAlJf3X4Q1T40Bub.jpg","certification":"12","genres":["Comédia","Ficção científica","Ação"],"trailer":"7rJF4cOo3_4"},
