"290512":{"id":"290512","name":"Depois Daquela Montanha","slug":"depois-daquela-montanha","original_title":"The Mountain Between Us","overview":"Adaptação do romance de Charles Martin. Alex (Kate Winslet), uma jornalista que está indo preparar seu casamento, e Ben (Idris Elba), um doutor voltando de uma conferência médica, iriam pegar o mesmo avião, mas o vôo é cancelado e os dois estranhos decidem fretar um jatinho. Durante a viagem o piloto sofre um ataque cardíaco e o avião cai em uma região montanhosa coberta por neve. Um romance começa a ganhar força enquanto eles tentam sobreviver, feridos e perdidos.","first_air_date":"2017-10-05","runtime":104,"episode_run_time":[104],"vote_average":6.7,"created_by":["Chernin Entertainment","20th Century Fox","Fox 2000 Pictures"],"production_companies":[{"name":"Chernin Entertainment"},{"name":"20th Century Fox"},{"name":"Fox 2000 Pictures"}],"cast":["Idris Elba","Kate Winslet","Dermot Mulroney","Beau Bridges","Linda Sorensen"],"backdrop_path":"https://image.tmdb.org/t/p/original/p7mUT8Usu1kNlfd1ugk6FwKejlo.jpg","poster_path":"https://image.tmdb.org/t/p/original/9b9RYlZ6CXCNl6BlgdmCboyFkdt.jpg","certification":"12","genres":["Drama","Aventura","Romance"],"trailer":"k-cdPmoQEsc"},
