"345":{"id":"345","name":"De Olhos Bem Fechados","slug":"de-olhos-bem-fechados","original_title":"Eyes Wide Shut","overview":"Alice, uma curadora de arte, é casada com o doutor Bill Harford. Juntos formam um casal perfeito, porém depois de participarem de uma festa, Alice confessa ter tido atração e fantasias sexuais com outro homem, que também estava na festa. Os dois começam a discutir e Bill passa a se perguntar o porquê disto estar acontecendo com ele, então ele vai procurar seu amigo Nick Nightingale, que irá lhe mostrar um mundo de fantasias e jogos sexuais.","first_air_date":"1999-07-16","runtime":159,"episode_run_time":[159],"vote_average":7.5,"created_by":["Warner Bros. Pictures","Stanley Kubrick Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Stanley Kubrick Productions"}],"cast":["Tom Cruise","Nicole Kidman","Sydney Pollack","Marie Richardson","Rade Šerbedžija"],"backdrop_path":"https://image.tmdb.org/t/p/original/vYA4qUPWY0EbjpcIXAL4h4pVmTC.jpg","poster_path":"https://image.tmdb.org/t/p/original/pmU8WQ2fOdxLuYaNe1kHE2L8SlI.jpg","certification":"18","genres":["Drama","Thriller","Mistério"],"trailer":"N/A"},
