"5825":{"id":"5825","name":"Férias Frustradas de Natal","slug":"ferias-frustradas-de-natal","original_title":"National Lampoon's Christmas Vacation","overview":"Clark Griswolds (Chevy Chase) promete à sua família um Natal maravilhoso. Ele enfeita a casa com mais de 20 mil luzes e prepara uma árvore que não cabe nem na sala de estar. Com tudo pronto, ele convida o resto da família para estar com eles. Quando chega a véspera do dia 24, depois de meses de preparo, as coisas não saem tão bem quanto o planejado, a começar por um peru explosivo e um gato enroscado nas luzinhas de Natal.","first_air_date":"1989-11-30","runtime":97,"episode_run_time":[97],"vote_average":7.2,"created_by":["Hughes Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Hughes Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Chevy Chase","Beverly D'Angelo","Juliette Lewis","Johnny Galecki","John Randolph"],"backdrop_path":"https://image.tmdb.org/t/p/original/klH8ti8LUaEhktnjdHb1RW8Yq6w.jpg","poster_path":"https://image.tmdb.org/t/p/original/cSkGfMmrtNqd3MmFtBFoq1Ruc8p.jpg","certification":"14","genres":["Comédia"],"trailer":"N/A"},
"660":{"id":"660","name":"007 Contra a Chantagem Atômica","slug":"007-contra-a-chantagem-atomica","original_title":"Thunderball","overview":"James Bond (Sean Connery) tenta evitar a destruição de Miami por meio de uma super bomba, roubada pela SPECTRE. A organização está exigindo um pagamento de 100 milhões de dólares em diamantes para não cumprir a ameaça de explodir a cidade. Para isso, ele vai correr contra o tempo para encontrar as armas roubadas e impedir a morte de milhões de inocentes.","first_air_date":"1965-12-11","runtime":130,"episode_run_time":[130],"vote_average":6.7,"created_by":["EON Productions"],"production_companies":[{"name":"EON Productions"}],"cast":["Sean Connery","Claudine Auger","Adolfo Celi","Luciana Paluzzi","Rik Van Nutter"],"backdrop_path":"https://image.tmdb.org/t/p/original/yQCaNJpqPtfMMvKt51rHghG1J2w.jpg","poster_path":"https://image.tmdb.org/t/p/original/ot8pEGo9Mljwkz7Ak8hv4qjBmsu.jpg","certification":"12","genres":["Aventura","Ação","Thriller"],"trailer":"N/A"},
"508":{"id":"508","name":"Simplesmente Amor","slug":"simplesmente-amor","original_title":"Love Actually","overview":"Nove histórias que se entrelaçam mostrando as complexidades da emoção que nos conecta a todos: o amor. Entre os personagens, o belo recém-eleito primeiro-ministro britânico, David, que se apaixona por uma jovem funcionária. Uma desenhista gráfica, Sarah, cuja devoção a seu irmão, doente mental, complica sua vida amorosa. Harry, um homem casado tentado por sua atraente nova secretária. São vidas e amores que se misturam na romântica Londres, e atingem o seu clímax na noite de Natal.","first_air_date":"2003-09-07","runtime":135,"episode_run_time":[135],"vote_average":7.1,"created_by":["Working Title Films","DNA Films","Universal Pictures","StudioCanal"],"production_companies":[{"name":"Working Title Films"},{"name":"DNA Films"},{"name":"Universal Pictures"},{"name":"StudioCanal"}],"cast":["Hugh Grant","Alan Rickman","Emma Thompson","Liam Neeson","Martine McCutcheon"],"backdrop_path":"https://image.tmdb.org/t/p/original/xUWf5xX0AnZgAnYXAMk03zTbsef.jpg","poster_path":"https://image.tmdb.org/t/p/original/zoZvqAlIt6U8XWyo2ROU2SpTVAc.jpg","certification":"16","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
"1924":{"id":"1924","name":"Superman: O Filme","slug":"superman-o-filme","original_title":"Superman","overview":"Jor-El, um renomado cientista, prevê a destruição do seu planeta e alerta o governo, que não lhe dá credito. Assim, decide salvar seu filho, mandando-o ao planeta Terra, onde terá superpoderes. Na Terra, ele usa o nome de Clark Kent e, já adulto, trabalha como repórter em um jornal, não demonstra ter superpoderes. Mas quando uma situação inesperada põe em risco a vida de Lois Lane, uma colega de trabalho, ele é obrigado a se revelar para o público, ficando conhecido popularmente como Superman. Descontente com o surgimento de um super-herói na cidade, Lex Luthor, um gênio do mal, o obriga a se desdobrar para evitar a morte de milhões de pessoas.","first_air_date":"1978-12-14","runtime":143,"episode_run_time":[143],"vote_average":7.1,"created_by":["Dovemead Films","Alexander and Ilya Salkind Productions","International Film Production"],"production_companies":[{"name":"Dovemead Films"},{"name":"Alexander and Ilya Salkind Productions"},{"name":"International Film Production"}],"cast":["Christopher Reeve","Margot Kidder","Gene Hackman","Marlon Brando","Ned Beatty"],"backdrop_path":"https://image.tmdb.org/t/p/original/5PfHGXosySGs0l1JfeREspy3v6G.jpg","poster_path":"https://image.tmdb.org/t/p/original/sm6BLvYCSe4pUpW2UrCKSsS1o0B.jpg","certification":"L","genres":["Ficção científica","Ação","Aventura"],"trailer":"N/A"},
