"8277":{"id":"8277","name":"American Pie: Caindo em Tentação","slug":"american-pie-caindo-em-tentacao","original_title":"American Pie Presents: Beta House","overview":"Erik Stifler e Cooze ingressam na vida acadêmica, na Universidade de Michigan. Os dois logo são são apresentados a Fraternidade Beta, presidida pelo lendário Dwight Stifler, primo de Erik. A Fraternidade Beta é famosa por suas festas. Enquanto os calouros tentam um lugar na irmandade, Dwight tenta salvar a Beta dos ataques da conservadora Fraternidade GEK, formada por nerds e comandada por Edgar que quer acabar com a supremacia dos libertinos.","first_air_date":"2007-12-26","runtime":88,"episode_run_time":[88],"vote_average":5.7,"created_by":["Rogue Pictures","Neo Art & Logic"],"production_companies":[{"name":"Rogue Pictures"},{"name":"Neo Art & Logic"}],"cast":["John White","Steve Talley","Christopher McDonald","Eugene Levy","Meghan Heffern"],"backdrop_path":"https://image.tmdb.org/t/p/original/qSx994cBgJ2jgc5Gx4hc3QjtJP0.jpg","poster_path":"https://image.tmdb.org/t/p/original/w3COJsjYRfrhWMLrnAbldPtisBV.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
