"88":{"id":"88","name":"Dirty Dancing: Ritmo Quente","slug":"dirty-dancing-ritmo-quente","original_title":"Dirty Dancing","overview":"Na esperança de curtir sua juventude, uma jovem fica decepcionada ao descobrir que seus pais passarão o verão de 1963 com ela em um resort na sonolenta região de Catskills. Mas sua sorte muda quando ela conhece o instrutor de dança do resort, Johnny, um rapaz com um passado bem diferente do dela. Quando ele a coloca como sua nova parceira, os dois acabam se apaixonando. Apesar do pai proibi-la de ver Johnny, ela não dá a mínima.","first_air_date":"1987-08-21","runtime":100,"episode_run_time":[100],"vote_average":7.3,"created_by":["Great American Films Limited Partnership","Vestron Pictures"],"production_companies":[{"name":"Great American Films Limited Partnership"},{"name":"Vestron Pictures"}],"cast":["Jennifer Grey","Patrick Swayze","Jerry Orbach","Cynthia Rhodes","Jack Weston"],"backdrop_path":"https://image.tmdb.org/t/p/original/6iDQCBUSZKzY8Rnu8ECwl2gXcfG.jpg","poster_path":"https://image.tmdb.org/t/p/original/mUVIRUpqKQa8uKDgyYrQHs6rlbz.jpg","certification":"12","genres":["Drama","Música","Romance"],"trailer":"ILH8KT0lbSA"},
