"11212":{"id":"11212","name":"Ninguém Segura Este Bebê","slug":"ninguem-segura-este-bebe","original_title":"Baby's Day Out","overview":"Em Chicago o bebê Bink tem todo o amor do mundo e tudo que o dinheiro pode comprar. Entretanto, três malandros, liderados por Norby (Joe Pantoliano), se passam por fotógrafos e seqüestram a criança. No entanto o bebê foge de forma fantástica e de forma mais fantástica ainda percorre a cidade, visitando os lugares que viu no seu livro e, de quebra, envolvendo os pilantras em diversas confusões.","first_air_date":"1994-07-01","runtime":99,"episode_run_time":[99],"vote_average":6.4,"created_by":["20th Century Fox","Hughes Entertainment"],"production_companies":[{"name":"20th Century Fox"},{"name":"Hughes Entertainment"}],"cast":["Joe Mantegna","Lara Flynn Boyle","Joe Pantoliano","Brian Haley","Cynthia Nixon"],"backdrop_path":"https://image.tmdb.org/t/p/original/hq8dZfJEem1SIBCElMAuaJIfl6Q.jpg","poster_path":"https://image.tmdb.org/t/p/original/dOpzTdejvtegkHGk5Uf5ILspXVe.jpg","certification":"N/A","genres":["Comédia","Aventura","Família","Crime","Drama"],"trailer":"N/A"},
"1370":{"id":"1370","name":"Rambo III","slug":"rambo-iii","original_title":"Rambo III","overview":"O companheiro e superior de John Rambo no Vietnã, o Coronel Samuel Trautman, foi designado para liderar uma missão na qual irá ajudar os rebeldes de Mujahedeen contra os soldados soviéticos que invadiram o Afeganistão. Durante a missão, Trautman é capturado e torturado pelo comandante russo Zaysen. A tensão e a adrenalina aumentam quando Rambo, ajudado por seus aliados rebeldes, botam em prática um plano para resgatar o coronel das mãos do inimigo.","first_air_date":"1988-05-24","runtime":102,"episode_run_time":[102],"vote_average":6.2,"created_by":["TriStar Pictures","Carolco Pictures"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Carolco Pictures"}],"cast":["Sylvester Stallone","Richard Crenna","Marc de Jonge","Kurtwood Smith","Σπύρος Φωκάς"],"backdrop_path":"https://image.tmdb.org/t/p/original/nEuPSz6LhmrtYp7K56dbsmomuqA.jpg","poster_path":"https://image.tmdb.org/t/p/original/jxzoYPjVa9pKL3fOejP3fPJTPpl.jpg","certification":"16","genres":["Ação","Aventura","Thriller","Guerra"],"trailer":"N/A"},
"8326":{"id":"8326","name":"O Mistério dos Escavadores","slug":"o-misterio-dos-escavadores","original_title":"Holes","overview":"Talvez por culpa de uma maldição que atinge os homens de sua família, o jovem Stanley Yelnats IV (Shia Labeouf) é condenado injustamente de ter roubado os tênis de Clyde Livingston (Rick Fox), um famoso atleta que os doara para um orfanato, para serem leiloados. Stanley precisa escolher entre ir para a prisão ou ir para o Acampamento do Lago Verde. Ele escolhe a 2ª opção, mas ao chegar lá vê que não há nenhum lago, pois o \"acampamento\" fica no deserto. Lá Stanley é forçado a cavar um enorme buraco todos os dias, assim como os outros jovens internos. A razão \"oficial\" deste esforço é que ajuda a moldar o caráter, mas a verdade é que a diretora Warden , juntamente com seus assistentes Mr. Sir (Jon Voight) e Dr. Pendanski , querem achar o tesouro ent pela pistoleira \"Beijoqueira\" Kate Barlow , que beijava os corpos de quem tinha matado.","first_air_date":"2003-04-18","runtime":117,"episode_run_time":[117],"vote_average":6.9,"created_by":["Phoenix Pictures","Chicago Pacific Entertainment","Walden Media","Walt Disney Pictures","Summit Entertainment"],"production_companies":[{"name":"Phoenix Pictures"},{"name":"Chicago Pacific Entertainment"},{"name":"Walden Media"},{"name":"Walt Disney Pictures"},{"name":"Summit Entertainment"}],"cast":["Shia LaBeouf","Khleo Thomas","Sigourney Weaver","Jon Voight","Patricia Arquette"],"backdrop_path":"https://image.tmdb.org/t/p/original/1z4auHDSf2Kh6OqOVmwbeWc2Jrn.jpg","poster_path":"https://image.tmdb.org/t/p/original/kxdmkyKXS31wOjGAhJFYkj2KnBg.jpg","certification":"N/A","genres":["Aventura","Família","Drama","Comédia"],"trailer":"N/A"},
