"109428":{"id":"109428","name":"A Morte do Demônio","slug":"a-morte-do-demonio","original_title":"Evil Dead","overview":"Um chalé abandonado. Uma antiga maldição. Um mal implacável. Os produtores originais se reúnem para apresentar uma genuinamente aterrorizante reinvenção de suas obras-primas de horror. Para ajudar Mia a se livrar das drogas, cinco amigos se isolam em um chalé na floresta. Quando descobrem o Livro dos Mortos, eles inconscientemente invocam demônios adormecidos. A partir deste acontecimento, os jovens, um após outro, vão sendo possuídos. Cabe a David, irmão de Mia, lutar pela sua sobrevivência e de sua irmã.","first_air_date":"2013-04-05","runtime":91,"episode_run_time":[91],"vote_average":6.6,"created_by":["TriStar Pictures","FilmDistrict","Ghost House Pictures"],"production_companies":[{"name":"TriStar Pictures"},{"name":"FilmDistrict"},{"name":"Ghost House Pictures"}],"cast":["Jane Levy","Shiloh Fernandez","Lou Taylor Pucci","Jessica Lucas","Elizabeth Blackmore"],"backdrop_path":"https://image.tmdb.org/t/p/original/zL8Xa10zuG97oz31yJorOCCVuZP.jpg","poster_path":"https://image.tmdb.org/t/p/original/7b2oD1oxUxdDft486Q7oPNPzMlf.jpg","certification":"18","genres":["Terror"],"trailer":"JBfub8SbtvU"},
