"9277":{"id":"9277","name":"Golpe de Mestre","slug":"golpe-de-mestre","original_title":"The Sting","overview":"Após o assassinato de um amigo em comum, o aspirante a vigarista Johnny Hooker junta-se ao velho Henry Gondorff para se vingar de Doyle Lonnega, o cruel chefe responsável pelo crime. Hooker e Gondorff implementam um plano elaborado para que Lonnegan não descubra que está sendo enganado. O grande golpe começa a se desenrolar, mas as coisas não saem como planejaram e a destemida dupla faz improvisações de última hora.","first_air_date":"1973-12-25","runtime":129,"episode_run_time":[129],"vote_average":8.0,"created_by":["Universal Pictures","The Zanuck/Brown Company","David Brown Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"The Zanuck/Brown Company"},{"name":"David Brown Productions"}],"cast":["Paul Newman","Robert Redford","Robert Shaw","Charles Durning","Ray Walston"],"backdrop_path":"https://image.tmdb.org/t/p/original/1r9lH3DaSWKGyvZaoo6BF5STOk5.jpg","poster_path":"https://image.tmdb.org/t/p/original/jEJ0ZucEdSe2nk6OSHFVQkxYZXG.jpg","certification":"18","genres":["Comédia","Crime","Drama"],"trailer":"N/A"},
"193893":{"id":"193893","name":"Tiras, Só Que Não","slug":"tiras-so-que-nao","original_title":"Let's Be Cops","overview":"O mais novo filme de parceiros policiais tem um pequeno problema: eles não são policiais. São dois pilantras que criam um plano para se passar por policiais. Num curto espaço de tempo eles passam a aplicar batidas, fichar garotas bonitas e correr de forma imprudente pelas ruas em uma viatura comprada na internet. Mas quando eles se envolvem com mafiosos de verdade, esses policiais de mentira terão de lidar com crimes reais.","first_air_date":"2014-08-13","runtime":104,"episode_run_time":[104],"vote_average":6.5,"created_by":["WideAwake Pictures","Genre Films","20th Century Fox"],"production_companies":[{"name":"WideAwake Pictures"},{"name":"Genre Films"},{"name":"20th Century Fox"}],"cast":["Jake Johnson","Damon Wayans Jr.","Rob Riggle","Nina Dobrev","James D'Arcy"],"backdrop_path":"https://image.tmdb.org/t/p/original/1ul446xlDIGXqN60eZ6FItXPAfu.jpg","poster_path":"https://image.tmdb.org/t/p/original/e4cm80tDFTdvsx5TXXEvEntREl3.jpg","certification":"16","genres":["Comédia"],"trailer":"IR8mVZSqGMM"},
"9072":{"id":"9072","name":"O Pequenino","slug":"o-pequenino","original_title":"Little Man","overview":"O anão Calvin mal saiu da prisão e já planeja um novo assalto a uma joalheria. Perseguido pela polícia, ele esconde o diamante na bolsa de Vanessa, cujo marido, Darryl, sonha em ter um filho. Aproveitando a oportunidade para recuperar a pedra, Calvin se veste como criança e é deixado em frente à casa de Darryl para que seja acolhido. O casal passa um final de semana com o pequeno e decide adotá-lo, acreditando ser um bebê abandonado.","first_air_date":"2006-08-31","runtime":98,"episode_run_time":[98],"vote_average":5.9,"created_by":["Wayans Bros. Entertainment","Revolution Studios"],"production_companies":[{"name":"Wayans Bros. Entertainment"},{"name":"Revolution Studios"}],"cast":["Marlon Wayans","Shawn Wayans","Kerry Washington","John Witherspoon","Tracy Morgan"],"backdrop_path":"https://image.tmdb.org/t/p/original/cpd1CcHwgjQMkACDC9R5LtQcGXK.jpg","poster_path":"https://image.tmdb.org/t/p/original/hhz8suBlc45xIyanIIAg7DmWHCB.jpg","certification":"N/A","genres":["Comédia","Crime"],"trailer":"N/A"},
"9833":{"id":"9833","name":"O Fantasma da Ópera","slug":"o-fantasma-da-opera","original_title":"The Phantom of the Opera","overview":"La Carlotta (Minnie Driver) é a diva de uma conceituada companhia teatral, que é responsável pelas óperas realizadas em um imponente teatro. Temperamental, La Carlotta se irrita pela ausência de um solo na nova produção da companhia e decide abandonar os ensaios. Com a estréia marcada para o mesmo dia, os novos donos do teatro não têm outra alternativa senão aceitar a sugestão de Madame Giry (Miranda Richardson) e escalar em seu lugar a jovem Christine Daae (Emmy Rossum), que fazia parte do coral. Christine faz sucesso em sua estréia, chamando a atenção do Visconde de Chagny (Patrick Wilson), o novo patrocinador da companhia. O Visconde e Christine se conheceram ainda crianças, mas ele apenas a reconhece na encenação da ópera. Porém o que nem ele nem ninguém da companhia, com exceção de Madame Giry, sabem é que Christine tem um tutor misterioso, que acompanha nas sombras tudo o que acontece no teatro: o Fantasma da Ópera (Gérard Butler).","first_air_date":"2004-12-08","runtime":141,"episode_run_time":[141],"vote_average":7.3,"created_by":["Warner Bros. Pictures","Odyssey Entertainment","Scion Films","The Really Useful Group"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Odyssey Entertainment"},{"name":"Scion Films"},{"name":"The Really Useful Group"}],"cast":["Gerard Butler","Emmy Rossum","Patrick Wilson","Miranda Richardson","Minnie Driver"],"backdrop_path":"https://image.tmdb.org/t/p/original/xW7pZW94IwOC5JDZnGemtuYVPVk.jpg","poster_path":"https://image.tmdb.org/t/p/original/tevlea1T7hUA5mZnnrbJnWjtJwV.jpg","certification":"N/A","genres":["Thriller","Drama","Romance"],"trailer":"N/A"},
